import { Link } from "react-router-dom";
import Container from "../Container/Container";

const Header = () => {
  return (
    <header>
      <Container>
        <nav>
          <ul>
            <li>
              <Link to="/">Super Heroes</Link>
            </li>
          </ul>
        </nav>
      </Container>
    </header>
  );
};

export default Header;
